 \u0647\u0627\u06cc \u062a\u062d\u0635\u06cc\u0644\u06cc \u06a9\u0627\u0646\u0627\u062f\u0627 \u0645\u06cc \u0628\u0627\u0634\u062f \u062a\u0642\u0648\u06cc\u062a \u062a\u0648\u0627\u0646\u0627\u06cc\u06cc \u06a9\u0627\u0646\u0627\u062f\u0627 \u062f\u0631 \u062d\u0641\u0638 \u0648 \u062c\u0630\u0628 \u062f\u0627\u0646\u0634\u062c\u0648\u06cc\u0627\u0646 \u062f\u06a9\u062a\u0631\u0627 \u062f\u0631 \u0633\u0637\u062d \u062c\u0647\u0627\u0646\u06cc \u0648 \u0627\u06cc\u062c\u0627\u062f \u06a9\u0627\u0646\u0627\u062f\u0627 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u06cc\u06a9 \u0645\u0631\u06a9\u0632 \u062c\u0647\u0627\u0646\u06cc \u0628\u0631\u0627\u06cc \u062a\u0639\u0627\u0644\u06cc \u062f\u0631 \u062a\u062d\u0642\u06cc\u0642\u0627\u062a \u0648 \u0622\u0645\u0648\u0632\u0634 \u0639\u0627\u0644\u06cc \u0627\u06cc\u062c\u0627\u062f \u0634\u062f\u0647 \u0627\u0633\u062a.\n\n\u0644\u06cc\u0646\u06a9 \u062f\u0627\u0646\u0634\u06af\u0627\u0647 \u0647\u0627\u06cc \u0645\u0646\u062a\u062e\u0628\nhttps://vanier.gc.ca/en/appendix_b_cgs_2021_22_to_2023_24.html\n\n\u0631\u0634\u062a\u0647 \u0647\u0627\u06cc \u062a\u062d\u0635\u06cc\u0644\u06cc \u0627\u0631\u0627\u06cc\u0647 \u0634\u062f\u0647 : \u0631\u0634\u062a\u0647 \u0647\u0627\u06cc \u0627\u0631\u0627\u06cc\u0647 \u0634\u062f\u0647 \u062a\u0648\u0633\u0637 \u062f\u0627\u0646\u0634\u06af\u0627\u0647 \u0647\u0627\u06cc \u0645\u0646\u062a\u062e\u0628 \u062f\u0631 \u0628\u062e\u0634 \u0647\u0627\u06cc\n\u0639\u0644\u0648\u0645 \u0627\u062c\u062a\u0645\u0627\u0639\u06cc\n\u0639\u0644\u0648\u0645 \u0627\u0646\u0633\u0627\u0646\u06cc\n\u0639\u0644\u0648\u0645 \u0637\u0628\u06cc\u0639\u06cc\n\u0645\u0647\u0646\u062f\u0633\u06cc\n\u0628\u0647\u062f\u0627\u0634\u062a \u0648 \u0633\u0644\u0627\u0645\u062a\n\n\u0627\u0645\u062a\u06cc\u0627\u0632\u0627\u062a \u0628\u0648\u0631\u0633\u06cc\u0647 : \u067e\u0631\u062f\u0627\u062e\u062a \u0633\u0627\u0644\u0627\u0646\u0647 50/000 \u062f\u0644\u0627\u0631 \u0628\u0647 \u062f\u0627\u0646\u0634\u062c\u0648\u06cc\u0627\u0646 \u067e\u0630\u06cc\u0631\u0641\u062a\u0647 \u0634\u062f\u0647\n\n\u0645\u062f\u0627\u0631\u06a9 \u0645\u0648\u0631\u062f \u0646\u06cc\u0627\u0632 \u0628\u0631\u0627\u06cc \u0628\u0648\u0631\u0633\u06cc\u0647 \u06a9\u0627\u0646\u0627\u062f\u0627 :\n\u0645\u062f\u0627\u0631\u06a9 \u06a9\u0627\u0631\u0634\u0646\u0627\u0633\u06cc \u0627\u0631\u0634\u062f \u0648 \u0631\u06cc\u0632 \u0646\u0645\u0631\u0627\u062a\n\u062e\u0644\u0627\u0635\u0647 \u0633\u0648\u0627\u0628\u0642 \u062a\u062d\u0642\u06cc\u0642\u0627\u062a\u06cc \u0648 \u067e\u0698\u0648\u0647\u0634\u06cc\n\u0645\u0642\u0627\u0644\u0627\u062a \u0648 \u06a9\u062a\u0627\u0628\u0647\u0627\u06cc \u0686\u0627\u067e \u0634\u062f\u0647\n3 \u0639\u062f\u062f \u062a\u0648\u0635\u06cc\u0647 \u0646\u0627\u0645\u0647\n\u06a9\u0627\u0648\u0631 \u0644\u062a\u0631 \u0648 \u0633\u06cc \u0648\u06cc\n\u0645\u062f\u0631\u06a9 \u0632\u0628\u0627\u0646 \u0627\u0646\u06af\u0644\u06cc\u0633\u06cc \u0648 \u2026. \n\n\u0646\u062d\u0648\u0647 \u062b\u0628\u062a \u0646\u0627\u0645 : \u0645\u062a\u0642\u0627\u0636\u06cc\u0627\u0646 \u0628\u0627\u06cc\u062f \u0627\u0632 \u0637\u0631\u06cc\u0642 \u062f\u0627\u0646\u0634\u06af\u0627\u0647 \u0647\u0627\u06cc\u06cc \u06a9\u0647 \u0633\u0647\u0645\u06cc\u0647 \u0628\u0648\u0631\u0633\u06cc\u0647 \u0648\u0646\u06cc\u0631 \u0631\u0627 \u062f\u0627\u0631\u0646\u062f \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u062f\u0647\u0646\u062f\n\n \u0645\u0647\u0644\u062a \u062b\u0628\u062a \u0646\u0627\u0645 : 1401/08/10\n\nhttps://vanier.gc.ca/en/home-accueil.html\n\ud83d\udd30\ud83d\udd30\ud83d\udd30\n#\u0628\u0648\u0631\u0633\u06cc\u0647_\u062f\u06a9\u062a\u0631\u06cc #\u0628\u0648\u0631\u0633\u06cc\u0647_\u062a\u062d\u0635\u06cc\u0644\u06cc #\u0628\u0648\u0631\u0633\u06cc\u0647_\u06a9\u0627\u0646\u0627\u062f\u0627 #\u0628\u0648\u0631\u0633\u06cc\u0647_\u062a\u062d\u0635\u06cc\u0644\u06cc_\u06a9\u0627\u0646\u0627\u062f\u0627 #\u0628\u0648\u0631\u0633\u06cc\u0647_\u062f\u