:"GraphSidecar","id":"2867752794580984485","edge_media_to_caption":{"edges":[{"node":{"text":"Juni\u00e1lis 2022 \u2705 \u2013 a 3 h\u00f3napos k\u00fclf\u00f6ldi programszakaszra k\u00e9sz\u00fcl\u00fcnk\n\nHa j\u00fanius, akkor MK\u00d6 Juni\u00e1lis. Id\u00e9n is megrendezt\u00fck az \u00e9v egyik legjobban v\u00e1rt \u00e9s az \u00f6szt\u00f6nd\u00edjasaink k\u00f6r\u00e9ben a legink\u00e1bb kedvelt esem\u00e9nyt, a Juni\u00e1list. Egy este, amikor \u00f6sszegy\u0171lik az MK\u00d6 k\u00f6z\u00f6ss\u00e9ge, jelenlegi \u00e9s kor\u00e1bbi \u00f6szt\u00f6nd\u00edjasok cser\u00e9lnek tapasztalatot.\ud83d\udcac\ud83d\uddfa\ufe0f\ud83e\udded\n\nA Juni\u00e1lisnak nagy hagyom\u00e1nya van, hiszen ilyenkor az idei \u00f6szt\u00f6nd\u00edjasok nemcsak az el\u0151z\u0151 \u00e9vek \u00f6szt\u00f6nd\u00edjasaival, hanem ak\u00e1r a t\u00edz \u00e9vvel ezel\u0151tti programindul\u00e1skor k\u00f6zigazgat\u00e1si karrierj\u00fcket megkezd\u0151 MK\u00d6 Alumnikkal is megismerkedhetnek, az \u00e9vfolyamok tagjai pedig m\u00e1r korm\u00e1nytisztvisel\u0151 koll\u00e9g\u00e1kk\u00e9nt k\u00f6sz\u00f6nthetik egym\u00e1st.\ud83e\udd1d\n\nB\u00fcszk\u00e9k vagyunk k\u00f6z\u00f6ss\u00e9g\u00fcnkre, amelyet az MK\u00d6 2021-es \u00e9vfolyam\u00e1nak egyik mentora, a Minisztereln\u00f6ks\u00e9g miniszterhelyettese, F\u00fcrjes Bal\u00e1zs k\u00f6sz\u00f6nt\u00f6tt.\u2728\n\nA miniszterhelyettesi k\u00f6sz\u00f6nt\u0151t k\u00f6vet\u0151en az MK\u00d6 tehets\u00e9ges \u00f6szt\u00f6nd\u00edjasai k\u00e1pr\u00e1ztatt\u00e1k el a k\u00f6z\u00f6ns\u00e9get: Sallai No\u00e9mi klarin\u00e9tm\u0171v\u00e9sz, az MK\u00d6 2021-es \u00e9vfolyam\u00e1nak \u00f6szt\u00f6nd\u00edjasa zenei bet\u00e9tet adott el\u0151,  Sz\u0151nyi M\u00e1t\u00e9, idei \u00f6szt\u00f6nd\u00edjasunk pedig egy leg\u00e9nyessel sz\u00f3rakoztatta a k\u00f6z\u00f6ns\u00e9get.\ud83c\udfbc\ud83d\ude4b\u200d\u2640\ufe0f\ud83d\ude4b\u200d\u2642\ufe0f\ud83d\udc62\n\nA 2022-es \u00e9vfolyamnak h\u00e1rom h\u00f3napos k\u00fclf\u00f6ldi programszakasz\u00e1hoz \u00e9s haz\u00e1nk k\u00e9pvisel\u00e9s\u00e9hez Lovassy \u00c1d\u00e1m, az MK\u00d6 PIB egykori eln\u00f6ke k\u00edv\u00e1nt sok sikert poh\u00e1rk\u00f6sz\u00f6nt\u0151j\u00e9ben.\ud83e\udd42\n\nSz\u00e1zn\u00e1l is t\u00f6bben voltunk a Juni\u00e1lison \u2013 de m\u00e9g \u00e9pp belef\u00e9rt\u00fcnk egy csoportk\u00e9pbe.\nId\u00e9n a vil\u00e1g 25 orsz\u00e1g\u00e1ba utaznak \u00f6szt\u00f6nd\u00edjasaink, hogy nemzetk\u00f6zi tapasztalatot szerezzenek, amelyet hazat\u00e9rve miniszt\u00e9riumi munk\u00e1juk sor\u00e1n kamatoztathatnak. A k\u00fclk\u00e9pviseletre felk\u00e9sz\u00edt\u00e9s\u00fck elkezd\u0151d\u00f6tt \u2013 hamarosan h\u00e1romnapos k\u00e9pz\u00e9ssel folytatjuk! \u261d\ufe0f\n\nMK\u00d6 - Karrier. K\u00f6z\u00f6ss\u00e9g. Nemzetk\u00f6zi tapasztalat. \ud83c\udded\ud83c\uddfa"}}]},"shortcode":"CfMTfkAoiKl","edge_media_to_comment":{"count":1},"taken_at_timestamp":1656082794,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289917355_1348493935639278_3999356535257935948_n.webp?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=w1HyWcm4Do8AX8P8ae2\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_PKF3ZptE6H8VSY09891-CowJm716gCh_yBC-_hhev1Q\u0026oe=62BD6B39\u0026_nc_sid=4efc9f","edge_liked_by":{"count":9},"edge_media_preview_like":{"count":9},"owner":{"id":"13287462229"},"thumbnail_src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289917355_1348493935639278_3999356535257935948_n.webp?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=w1HyWcm4Do8AX8P8ae2\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_rep6L_SlRa-x1giWTaJyhfuNXRfvbDGx4RHd7Gql3Lg\u0026oe=62BD6B39\u0026_nc_sid=4efc9f","thumbnail_resources":[{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289917355_1348493935639278_3999356535257935948_n.webp?stp=dst-jpg_e35_s150x150\u