://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289600320_753734785878465_6667482073123268281_n.jpg?stp=dst-jpg_e15_s480x480\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=109\u0026_nc_ohc=oTzzVpi1VCYAX9Ltk7k\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT9cxOpfKamSVKFfWNivVIbgHSY1WAozDI0GX3k1Nq_0hw\u0026oe=62BDB5AE\u0026_nc_sid=4efc9f","config_width":480,"config_height":480},{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289600320_753734785878465_6667482073123268281_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=109\u0026_nc_ohc=oTzzVpi1VCYAX9Ltk7k\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT9g_VCKXL2lNtEP8STxOpWPzHkG0ULnglAQApyzffEL2Q\u0026oe=62BDB5AE\u0026_nc_sid=4efc9f","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":null}},{"node":{"comments_disabled":false,"__typename":"GraphSidecar","id":"2867749312090366597","edge_media_to_caption":{"edges":[{"node":{"text":"[BEASISWA MENTOR MAHASISWA NASIONAL 2022]\n\nHalo sobat beasiswa JC!!\ud83d\udc4b\ud83c\udffb\ud83d\udcda\n\nSaya Erviana Ika Fitriani dari Universitas Negeri Semarang siap menjadi bagian dari Beasiswa Mentor Mahasiswa Nasional 2022 yang diselenggarakan oleh @jalurcerdas.idn bersama Yayasan Bangun Kecerdasan Bangsa @ybkb.official\n\nDengan adanya beasiswa ini saya merasa terdorong dan terbimbing dalam aksi membantu pendidikan di Indonesia pada program-program yang diberikan oleh Yayasan tersebut dan Meningkatkan skill-skill yang saya miliki serta dapat berkontribusi terhadap kecerdasan bangsa Indonesia ini.\n\n#BeasiswaMENTORMAHASISWA2022 merupakan program pengembangan mahasiswa untuk berbagi kisah, motivasi, serta pengelolaan ekosistem ribuan siswa SMA/sederajat di seluruh Indonesia. Disini kamu akan menjadi mentor dalam pengembangan pendidikan generasi bangsa. Kamu juga akan learn by doing dalam pengelolaan komunitas bertaraf nasional, program ini juga salah satu kontribusi dalam menggerakkan semangat belajar dan membantu pendidikan di Indonesia semakin maju \ud83c\uddee\ud83c\udde9\ud83c\udfc5\n\n\"Education is the passport to the future.\" Jangan takut gagal, karena arti kalah yang sesungguhnya adalah orang yang tidak berani mencoba.\n\nSaya ajak kamu @tiramvisue , @_salsarrr , @nr.rhmwt untuk bersama-sama melangkah menjadi bagian dari beasiswa jalur cerdas.\n\nInformasi lebih lengkap silahkan baca panduan beasiswa di :\nhttps://linktr.ee/mentormahasiswanasional2022\n\nContact Person :\n0857 6976 0576 (Kak Febrian)\n0812 7817 4619 (Kak Ayu)\n\n=====================\nSupport us :\n@ybkb.official\n@jalurcerdas.id\n\n#MentorMahasiswaNasional2022 #BeasiswaJalurCerdas #BangunKecerdasanBangsa #beasiswa #scholarship #beasiswakuliah #beasiswapendidikan #infobeasiswa #beasiswaindonesia #beasiswamahasiswa #scholarshipindonesia"}}]},"shortcode":"CfMSs4sBGKF","edge_media_to_comment":{"count":0},"taken_at_timestamp":1656082379,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289722375_586011326274770_5214388216437243470_n.webp?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=102\u0026_nc_ohc=8RTosOLXD-0AX8JPxsO\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8gZ7Ltxq7pNYUolA8A3SKaXzOCNxHtUfokyxslKJyuxA\u0026oe=62BCE95A\u0026_nc_sid=4efc9f","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"48502278998"},"thumbnail_src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289722375_586011326274770_5214388216437243470_n.webp?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=102\u0026_nc_ohc=8RTosOLXD-0AX8JPxsO\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT9MIkQt97r20GzReR8lvj4oUbr9CW5sWwZHD8NNWX-MlQ\u0026oe=62BCE95A\u0026_nc_sid=4efc9f","thumbnail_resources":[{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289722375_586011326274770_5214388216437243470_n.webp?stp=dst-jpg_e35_s150x150\u0026_nc_ht=