67749058422476648","edge_media_to_caption":{"edges":[{"node":{"text":"Countdown to Nationals:\n\nMy Village:\n\nIt truly takes a village to compete and prepare - I\u2019m so grateful for mine! \n\nMrs. Stephanie @violetspromandpageant I\u2019m thankful for your friendship, your encouragement, support, loving on me and always making me feel my best. \n\n@ashleylauren \nMrs. Ashley the style goddess I am so excited about each piece of my national wardrobe, I can\u2019t wait to show it off. I am thankful for your friendship, talent and fabulous eye for design. \n\n@kellyhbrown @tgregb @collinhay \nThe best family anyone could ask for. Your support and dedication to following me around watching while I do what I enjoy is appreciated more than you will ever know. \n\n@thats.so.raygan \nMy adopted sister, biggest fan, sounding board and friend. I love you and appreciate you always making time for me and loving on me. \n\n@mikailanoel \nThe smartest person I know.\nMikaila you always have me ready to go. You calm me, build my confidence, but mostly love me and believe in me. I love you. \n\n@carlosvelezstudios \n@teamflawless.co \nCarlos thank you so much for my beautiful new headshots. You all are so fun to work with, it was truly a joy!!! \n\n@oh_layyy \nLayilah were do I start. I feel like from the first conversation we connected. Thank you for supporting my dream, taking a USA girl and teaching her all things UNM and the unlimited amount of advice. You are truly the best. I value and appreciate you and your talents. \n\n@usanationalpreteen \nAva Mae thank you for introducing me to UNM encouraging me to compete, being the best volunteer partner and mostly a good friend. \n\n@jackiebwatson and @usanationalmiss thank you for all the work that you put into this system and the opportunity to compete for such an incredible job. \n\nThe University of Arkansas you have educated me, supported my ideas and encouraged me to reach my professional and personal goals.  Partnering with me creating scholarship and opportunity for women in the field of stem. \n\n#unm #unminspire #positivepageantry #usanationalmiss #universityofarkansas #stem #youcansitwithus #pageantsinparadise #womeninstem #scholarship #inspire #unmteenarkansas"}}]},"shortcode":"CfMSpMcO49o","edge_media_to_comment":{"count":1},"taken_at_timestamp":1656082349,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/289460664_185464557159511_4010505437062200496_n.jpg?stp=dst-jpg_e35_s1080x1080\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=107\u0026_nc_ohc=e58pUZ5ALsIAX8Q1aRr\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_mtVYDYzm3c-w9aSOLjZ-m-qe5KfdITRl2_4WuccgGIQ\u0026oe=62BC2C5E\u0026_nc_sid=4efc9f","edge_liked_by":{"count":14},"edge_media_preview_like":{"count":14},"owner":{"id":"4053736237"},"thumbnail_src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/289460664_185464557159511_4010505437062200496_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=107\u0026_nc_ohc=e58pUZ5ALsIAX8Q1aRr\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT9ttgtqTq5AbtU7cHE5-7edvVQSrNMwB5B70TxpaI6mGw\u0026oe=62BC2C5E\u0026_nc_sid=4efc9f","thumbnail_resources":[{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/289460664_185464557159511_4010505437062200496_n.jpg?stp=dst-jpg_e35_s150x150\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=107\u0026_nc_ohc=e58pUZ5ALsIAX8Q1aRr\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8kfyMoR9vp7iJDsFsZx6AD-O7aZm6Mscjl9mGGVKi0ZQ\u0026oe=62BC2C5E\u0026_nc_sid=4efc9f","config_width":150,"config_height":150},{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/289460664_185464557159511_4010505437062200496_n.jpg?stp=dst-jpg_e35_s240x240\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=107\u0026_nc_ohc=e58pUZ5ALsIAX8Q1aRr\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-b4p05vUd5CdBXJHOKLn5JlqMq-ae34UwLzZSSiyp_WA\u0026oe=