ous. Recent works include machines to encourage entropy, web programs, looped films, fairground stalls, paintings and intricate photographic constructions focusing on, subverting, reimagining and manipulating the origins of the medium.\n\nHer 3-day workshop \"Between Intention and Realisation\" will encourage you to explore random and intuitive imagery that goes beyond conventional ideas of research and logical thinking. It is ideal for those who want to challenge their usual ways of visualising and who wish to expand their practice into new and challenging areas. If you\u2019ve reached a sticking point this could be a chance to get unstuck.\n\nHit the top link in bio to learn more on Clare's class, and apply for one for two half scholarships by July 4th!\n\nOr visit:\n\nhttps://fotofilmic.com/clare-strand/\n\nPhoto \u00a9 Clare Strand, Girl in Two Halves, 2008. From the series Conjurations.\n\n#clarestrand #conceptualphotography #mentorship #photographyclass #artpractice #critiques #fotofilmic #photographycommunity #scholarship"}}]},"shortcode":"CfMSj7MLFjr","edge_media_to_comment":{"count":0},"taken_at_timestamp":1656082306,"dimensions":{"height":579,"width":750},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/290125963_977377966287078_6634199535956824963_n.jpg?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=PiMZsMpJo9AAX-sQ28w\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_4E5O3Y-kFQXWFjqdpZATZ2vdbbceffyaIRdpj_V9ayQ\u0026oe=62BD669C\u0026_nc_sid=4efc9f","edge_liked_by":{"count":19},"edge_media_preview_like":{"count":19},"owner":{"id":"1425540199"},"thumbnail_src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/290125963_977377966287078_6634199535956824963_n.jpg?stp=c82.0.556.556a_dst-jpg_e35\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=PiMZsMpJo9AAX-sQ28w\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_iH1VB2K2fUPfEvmHYy0EZ-6ARMFPTL-nsxgJJvdl4DA\u0026oe=62BD669C\