ath: Why Join Management Trainee Programs\n\ud83c\udf1fYoung \u0026 Successful: Becoming Superstar in Any Company\n\nPeserta terpilih akan mendapatkan:\n\ud83e\uddf3 100% Fully-Funded Life-Changing Leadership Trip (6 Hari 5 Malam ke New York \u0026 Boston)\n\ud83c\udfeb Campus Tour Harvard \u0026 MIT\n\u2708\ufe0f Transportasi dari Asal Daerah, selama di USA, sampai Kepulangan\n\ud83d\udcb0 Uang Saku, Tanggungan Akomodasi \u0026 Tiket Atraksi\n\ud83d\udcd4 Pembuatan Paspor \u0026 Visa\n\ud83d\udcd1 E-Certificate Internasional (Top 6, Top 50, Top 150, Peserta Webinar, Peserta Seleksi)\n\ud83d\udc65 Keanggotaan Group Exclusive \u0026 Networking SejutaCita Future Leaders 2022\n\ud83c\udf93 Support Sistem dalam Berprestasi (komunitas saling mendukung menggapai cita-cita) \n\ud83d\ude80 Pengalaman trip tidak terlupakan seumur hidup\n\n\ud83c\udff7\ufe0f Daftar sekarang di rebrand.ly/SDFL1\n\n\ud83d\udcda Cek informasi lengkap di Instagram @sejutacita.id\n\u260e\ufe0f Punya pertanyaan? Hubungi +62-818-0668-0617 (Bella)\n\n#sejutacita #deall #fullyfunded #trip #studentexchange #scholarshipindonesia #beasiswaluarnegeri #exchange #scholarship #indonesia #beasiswa #Infobeasiswa #studyabroad #mahasiswabaru #infokerja #infowebinar #youthexchange #youth #competition #lomba #infolomba #eventkampus #event #infoevent #eventmahasiwa #usa #harvard #mit #generasibangunnegeri #bakrie80tahun"}}]},"shortcode":"CfMSbD_phQu","edge_media_to_comment":{"count":0},"taken_at_timestamp":1656082233,"dimensions":{"height":1078,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289486887_610565206787314_6756349217165339424_n.jpg?stp=dst-jpg_e35_s1080x1080\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=110\u0026_nc_ohc=8pHu29vbpt8AX-I8evP\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT9qDfL883SCqzY2i22QhYX79BIH31mc6fR5i9JclAVHmw\u0026oe=62BC767A\u0026_nc_sid=4efc9f","edge_liked_by":{"count":1},"edge_media_preview_like":{"count":1},"owner":{"id":"39499298073