webp?stp=c0.99.1080.1080a_dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=105\u0026_nc_ohc=5_0JuRrYto0AX_PiS6-\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-C0POpwm8vZQcdpemkOUQ2rHBaVQzET4yHUHFNt9sxkw\u0026oe=62BC94F8\u0026_nc_sid=4efc9f","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":null}},{"node":{"comments_disabled":false,"__typename":"GraphSidecar","id":"2867744953171995558","edge_media_to_caption":{"edges":[{"node":{"text":"[BEASISWA MENTOR MAHASISWA NASIONAL 2022]\n\nHalo sobat beasiswa JC!!\ud83d\udc4b\ud83c\udffb\ud83d\udcda\n\nSaya Kristine Lumban Gaol dari Universitas Pembangunan Nasional \"Veteran\" Jawa Timur siap menjadi bagian dari Beasiswa Mentor Mahasiswa Nasional 2022 yang diselenggarakan oleh @jalurcerdas.idn bersama Yayasan Bangun Kecerdasan Bangsa @ybkb.official\n\nDengan adanya beasiswa ini mahasiswa dapat mengembangkan potensi kemampuan dan minat bakat dalam membangun dan meningkatkan mutu Pendidikan di Indonesia\n\n#BeasiswaMENTORMAHASISWA2022 merupakan program pengembangan mahasiswa untuk berbagi kisah, motivasi, serta pengelolaan ekosistem ribuan siswa SMA/sederajat di seluruh Indonesia. Disini kamu akan menjadi mentor dalam pengembangan pendidikan generasi bangsa. Kamu juga akan learn by doing dalam pengelolaan komunitas bertaraf nasional, program ini juga salah satu kontribusi dalam menggerakkan semangat belajar dan membantu pendidikan di Indonesia semakin maju \ud83c\uddee\ud83c\udde9\ud83c\udfc5\n\n\"Education is the passport to the future.\" Jangan takut gagal, karena arti kalah yang sesungguhnya adalah orang yang tidak berani mencoba.\n\nSaya ajak kamu @chaterinesilangit20 @nandaalg @endangagustinaa_ untuk bersama-sama melangkah menjadi bagian dari beasiswa jalur cerdas.\n\nInformasi lebih lengkap silahkan baca panduan beasiswa di :\nhttps://linktr.ee/mentormahasiswanasional2022\n\nContact Person :\n0857 6976 0576 (Kak Febrian)\n0812 7817 4619 (Kak Ayu)\n\n=====================\nSupport us :\n@ybkb.official\n@jalurcerdas.id\n\n#MentorMahasiswaNasional2022 #BeasiswaJalurCerdas #BangunKecerdasanBangsa #beasiswa #scholarship #beasiswakuliah #beasiswapendidikan #infobeasiswa #beasiswaindonesia #beasiswamahasiswa #scholarshipindonesia"}}]},"shortcode":"CfMRtdIPGum","edge_media_to_comment":{"count":0},"taken_at_timestamp":1656081860,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/290244932_3249552078655314_7655581173945813301_n.webp?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=N0VIKsRHV88AX_mYrY8\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT98g0xzL92r0g00p-TxVM85c-Q2GVJ39hedQwWGeG1EZg\u0026oe=62BD7549\u0026_nc_sid=4efc9f","edge_liked_by":{"count":16},"edge_media_preview_like":{"count":16},"owner":{"id":"5684695968"},"thumbnail_src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/290244932_3249552078655314_7655581173945813301_n.webp?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=N0VIKsRHV88AX_mYrY8\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_IgxvvXr4by7A_xRPUHxGDwnoD2Nm6IxnT_efmSP2Agg\u0026oe=62BD7549\u0026_nc_sid=4efc9f","thumbnail_resources":[{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/290244932_3249552078655314_7655581173945813301_n.webp?stp=dst-jpg_e35_s150x150\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=N0VIKsRHV88AX_mYrY8\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-WZId0WQzTcTxZWvJcT0rOpK0v4maHfrwpOpLTPUIY3Q\u0026oe=62BD7549\u0026_nc_sid=4efc9f","config_width":150,"config_height":150},{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/290244932_3249552078655314_7655581173945813301_n.webp?stp=dst-jpg_e35_s240x240\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=N0VIKsRHV88AX_mYrY8\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT9o_kxYrdmIOts9SgVeYis6IryVPz3D