a ini karena menurut saya kegiatan seperti ini sangat perlu saya dapatkan untuk mendapatkan kemampuan akan hal-hal baru yang dapat menunjang self-improvement saya  kedepannya . Terakhir , dengan adanya program ini saya sangat tertarik untuk memiliki komunitas-komunitas baru yang mampu menambah networking saya yang pastinya asik , seru , dan menyenangkan .\n\n#BeasiswaMENTORMAHASISWA2022 merupakan program pengembangan mahasiswa untuk berbagi kisah, motivasi, serta pengelolaan ekosistem ribuan siswa SMA/sederajat di seluruh Indonesia. Disini kamu akan menjadi mentor dalam pengembangan pendidikan generasi bangsa. Kamu juga akan learn by doing dalam pengelolaan komunitas bertaraf nasional, program ini juga salah satu kontribusi dalam menggerakkan semangat belajar dan membantu pendidikan di Indonesia semakin maju \ud83c\uddee\ud83c\udde9\ud83c\udfc5\n\n\"Education is the passport to the future.\" Jangan takut gagal, karena arti kalah yang sesungguhnya adalah orang yang tidak berani mencoba.\n\nSaya ajak kamu @timothy.subekti @gresranita @gracia.tb untuk bersama-sama melangkah menjadi bagian dari beasiswa jalur cerdas.\n\nInformasi lebih lengkap silahkan baca panduan beasiswa di :\nhttps://linktr.ee/mentormahasiswanasional2022\n\nContact Person :\n0857 6976 0576 (Kak Febrian)\n0812 7817 4619 (Kak Ayu)\n\n=====================\nSupport us :\n@ybkb.official\n@jalurcerdas.id\n\n#MentorMahasiswaNasional2022 #BeasiswaJalurCerdas #BangunKecerdasanBangsa #beasiswa #scholarship #beasiswakuliah #beasiswapendidikan #infobeasiswa #beasiswaindonesia #beasiswamahasiswa #scholarshipindonesi"}}]},"shortcode":"CfMRbqZPyJY","edge_media_to_comment":{"count":0},"taken_at_timestamp":1656081714,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/289799710_411546044323776_5660324347297332551_n.webp?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=100\u0026_nc_ohc=nyj1AEMah18AX9gXYNI\u0026edm=ABZsPhsBAAAA\u0026cc