h=00_AT9P1eIkU32xGrJDHEUWf6tu1JP3bojU8ptoVim1Fb4o8A\u0026oe=62BCF8D2\u0026_nc_sid=4efc9f","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":null}},{"node":{"comments_disabled":false,"__typename":"GraphImage","id":"2867740805731484852","edge_media_to_caption":{"edges":[{"node":{"text":"EXTENDED REGISTRATION !!!\n\nAda kabar baik nih boosters, pendaftaran Bimbo Scholarship akan diperpanjang sampai tgl 15 Juli 2022\n\n\u2714\ufe0fKamu pengen banget dapet beasiswa ke luar negeri kayak Oxford, Harvard, Stanford? \n\u2714\ufe0fAtau masih galau karena biaya UKT mahal tapi nga punya beasiswa? Mau daftar bimbingan tapi biayanya mahal-mahal\ud83e\udee3?\n\nTenang aja, kami Boosternesia\ud83d\ude80 menghadirkan solusi untukmu booster!\n\ud83c\udf93BimBo Scholarship\ud83c\udf93\n\n\ud83d\udcabBimBo Scholarship merupakan program mentoring beasiswa untuk membantu kamu meraih beasiswa S1 dalam negeri dan S2 dalam maupun luar negeri\ud83e\udd29\n\nDisini kamu akan dibimbing oleh para *AWARDEE BEASISWA LPDP, BEASISWA UNGGULAN, YTB TURKEY,XL FUTURE LEADERS, DAN BEASISWA BERGENGSI LAINNYA* mulai dari mengenali diri kamu, sampai praktek langsung untuk daftar beasiswanya !\ud83d\ude0e Nga hanya dapat materi dan sertifikat aja kamu juga akan :\n\u2705Tau cara mempersiapkan berkas dan lolos seleksi beasiswa\n\u2705Mendapatkan buku hard file bimbingan beasiswa LPDP/Cara Lolos Kampus Luar Negeri/Dll secara *GRATIS* untuk tiap mentee terbaik \n\u2705Berkesempatan bertemu para pejuang mimpi dan di Dreca World atau *dunia mimpi* yang dimiliki Boosternesia \n\u2705Memperluas relasi secara nasional dan akan diajarkan cara mendapatkan relasi internasional untuk memudahkan kamu meraih beasiswa. Yuk segera daftar !\n\n\u260e\ufe0fNarahubung pendaftaran : 085894005477 (Kak Dela)\n\ud83d\udd17Link Info lengkap tentang program : https://bit.ly/BookletBimboScholarshipp\n\n\u26a0\ufe0f Slot terbatas hanya untuk 70 orang tercepat \ud83d\ude0a\n\n*\ud83d\udd30Deadline pendaftaran 15 Juli 2022*\n\n#bimbinganbeasiswa #beasiswabahasainggris #beasiswaluarnegeri #infobeasiswa #beasiswa #beasiswas1 #beasiswas2 #info #bahasainggris #oxford #indonesia #info #scholarship #turkey #t\u00fcrkiye  #pelajar #australia #unitedkingdom #amerika #kampus #sbmptn2022 #sbmptn"}}]},"shortcode":"CfMQxGhhIS0","edge_media_to_comment":{"count":0},"taken_at_timestamp":1656081365,"dimensions":{"height":1350,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289591267_164400889413567_7042093081144431232_n.webp?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=103\u0026_nc_ohc=GhD-aqPWJ8IAX9-2wcq\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT9q38XDmE2m3jaXIIX8jdL6PQmYfKYlEM4W9kEavGU2Sw\u0026oe=62BD50EC\u0026_nc_sid=4efc9f","edge_liked_by":{"count":17},"edge_media_preview_like":{"count":17},"owner":{"id":"36873974339"},"thumbnail_src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289591267_164400889413567_7042093081144431232_n.webp?stp=c0.135.1080.1080a_dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=103\u0026_nc_ohc=GhD-aqPWJ8IAX9-2wcq\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8lSmOfI9JbGJGD_CVf85kFpVaz-eCNE8WW3NI6_ohSCg\u0026oe=62BD50EC\u0026_nc_sid=4efc9f","thumbnail_resources":[{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289591267_164400889413567_7042093081144431232_n.webp?stp=c0.135.1080.1080a_dst-jpg_e35_s150x150\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=103\u0026_nc_ohc=GhD-aqPWJ8IAX9-2wcq\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT9T7nNRSJP1E66oPrBeT1nb39uxP72zgC8_Cy8JLMKVpA\u0026oe=62BD50EC\u0026_nc_sid=4efc9f","config_width":150,"config_height":150},{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289591267_164400889413567_7042093081144431232_n.webp?stp=c0.135.1080.1080a_dst-jpg_e35_s240x240\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=103\u0026_nc_ohc=GhD-aqPWJ8IAX9-2wcq\u0026edm=ABZsP