f my time into the nursing program and learning. This scholarship will play a big role in achieving my educational goals. Thank you for your investment in Wallace State and the futures of students like me. I hope one day I can inspire and help others as you have helped me.\"\n\nRocio is a 2022-23 Future Foundation Scholarship recipient. Her goal as a WSCC Lion is to graduate from nursing school next August. She plans to work on her associate\u2019s degree in nursing for a couple years to gain experience in the operating room and pediatrics, then continue her education to become a CRNA. (Certified Registered Nurse Anesthetist)\n We are so glad to see Rocio focus on the needs of others and their health! \ud83e\ude7a\n\n#wallacestate #FutureFoundation #wallacestatecommunitycollege #wscc #scholarship"}}]},"shortcode":"CfMMrvesR8J","edge_media_to_comment":{"count":0},"taken_at_timestamp":1656079224,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289900568_475319414398798_6313317047510036528_n.jpg?stp=dst-jpg_e15_fr_s1080x1080\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=110\u0026_nc_ohc=T4nlFhM1XAkAX9LAre8\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-csf9ooZU3pdPWwNV6jtjs7UGMPX2NsDBuOvYsLKgTjA\u0026oe=62BD07DC\u0026_nc_sid=4efc9f","edge_liked_by":{"count":8},"edge_media_preview_like":{"count":8},"owner":{"id":"3895944496"},"thumbnail_src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289900568_475319414398798_6313317047510036528_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=110\u0026_nc_ohc=T4nlFhM1XAkAX9LAre8\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8DhzNyzqk6ETVVbyFwbUre-32ff052UX8gjMYJAeyOgg\u0026oe=62BD07DC\u0026_nc_sid=4efc9f","thumbnail_resources":[{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289900568_475319414398798_6313317047510036528_n.jpg?stp=dst-jpg_e15_s150x150\u0026_nc_ht=instagram.flos1-1.fna.fbcdn