jpg_e35_s480x480\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=GtbHANAt8VwAX9a_mbp\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8J-2unMwk0jHwIwfhDNrF-VUb2vW4yGs9iJWWCHoE2Mg\u0026oe=62BC8D2E\u0026_nc_sid=4efc9f","config_width":480,"config_height":480},{"src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/289651036_562688502145218_8417450978215888196_n.jpg?stp=c166.0.667.667a_dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=GtbHANAt8VwAX9a_mbp\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-Dz1fwq3m-I-pq2lRwOXcgGpLLBwYvtL2d_VHGi_mt-g\u0026oe=62BC8D2E\u0026_nc_sid=4efc9f","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":null}},{"node":{"__typename":"GraphImage","id":"2867535268362502511","edge_media_to_caption":{"edges":[{"node":{"text":"Some amazing flowers for your Friday \ud83d\ude0d This week I was lucky enough to be joined @library_vic by the team involved in the ARC Linkage Grant project on the John Emmerson Collection - Rosalind Smith, Paul Salzman, Sarah Ross, Mitchell Whitelaw, Patricia Pender (by Zoom!), Julia Rodwell and Julie Robarts. We've had to conduct most of this project remotely due to Melbourne's lockdowns, so it was a special pleasure to be together with each other and the books. We talked a lot about the aura of books, their materiality, and how we hope to bring this alive in the digital exhibition we're making, which will launch in August 2023. A busy, productive, enriching and fun week - I love this project and these colleagues \ud83e\udd70 \n\nIf you are a member of ANZAMEMS (Australian \u0026 New Zealand Association of Medieval and Early Modern Studies), you can join us for two sessions about our research on this project next week for the biennial conference (online). \n\nThese flowers are part of the spine decoration of the binding with the silver lions I posted not long ago - a Book of Common Prayer (1634) and a Book o